description:
I came across this cd in a parking lot about a month ago, i been searching and after a lot of crap i came upon this. I finally have the full album, i guess theres a lot stuff floating around of this artist and i think hes worth the listening to, better than most stuff these days


{Copied from an anonymous poster}


This mixtape is the debut underground release from new artist Zulu. Zulu is an unsigned artist, who uses his music to inspire thinking and change. this much political and racially driven album, is infused with Tupac Shakur, giving us a fresh, new sound, and some things to think about. Enjoy!!
